import React from "react";
import Footer from "../Reusable Components/Footer";
import NavBar from "../Reusable Components/Navbar";
import ContactPane from "./ContactPane";

const Contact = () => {
	return (
		<div className="contact">
			<NavBar />
            <ContactPane />
            <Footer />
		</div>
	);
};

export default Contact;
